console.log(usersAgeOlderType);
/*Задача 4. Есть массив чисел [526, 42, 67, 183, 16, 81]. Необходимо получить отсортированный по возрастанию массив, в котором есть только числа больше 50.*/
var numbers = [526, 42, 67, 183, 16, 81, 51, 21, 11];
var numbersAbove50 = numbers.filter(function (item) { return item > 50; });
var compareFn = function (a, b) { return a - b; };
var numbersAbove50Sort = numbersAbove50.sort(compareFn);
